import Test.HUnit

import Game
import Data.Maybe

boardFromList :: [[Maybe Player]] -> Board
boardFromList list = Board { boardSize = n
                           , boardGoal = if n == 3 then 3 else 4
                           , boardCell = getCell
                           }
  where n = length list
        getCell (x, y)
          | x >= 0 && x < n && y >= 0 && y < n = case list !! x !! y of
                                                   Just p -> FilledCell p
                                                   Nothing -> EmptyCell
          | otherwise = EmptyCell

testBoard :: GamePreset -> Maybe Player -> [[Maybe Player]] -> Test
testBoard preset winner board = TestCase $ do
  let b = boardFromList board
  assertEqual "winner detection works" winner (getBoardWinner b)
  assertEqual "board moves work" (length $ filter isNothing $ concat board) (length $ getBoardMoves b)

main = runTestTT tests

